import React from "react";
import gym1 from "./images/gym1.jpg";

const Firstpage = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-10 mx-auto" >
            <div className="row">
              <div className="col-md-6" style={{ border: "2px solid" }}>
                  
              </div>
              <div className="col-md-6" style={{ border: "2px solid" }}>
                  <img src = {gym1} className = "img-fluid"/>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Firstpage;
